class Response:

    def __init__(self, url, data=None, headers=None):
        self.url = url
        self.data = data or {}
        self.headers = {'expires': (datetime.utcnow() + timedelta(seconds=
            300)).strftime('%a, %d %b %Y %H:%M:%S GMT')}
        if headers:
            self.headers.update(headers)

    def json(self):
        return self.data
